// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract User{

    constructor() {
        setRole();
        setRector();
        setAADepartmentAcc();
    }

    struct role {
        string id;
        string name;
    }

    role[4] roleList;
    mapping(address => role) userRole;

    function getCurrentUserRole() public view returns (role memory) {
        return userRole[msg.sender];
    }

    function getCurrentUser() public view returns (rector memory, AADUser memory, student memory, company memory){
        if (keccak256(abi.encodePacked(userRole[msg.sender].id)) == keccak256(abi.encodePacked("0"))){
            return (rectorDetail[msg.sender],getAADepartmentUser(msg.sender),getStudentByAddr(msg.sender),getCompany(msg.sender));
        } else if (keccak256(abi.encodePacked(userRole[msg.sender].id)) == keccak256(abi.encodePacked("1"))){
            return (rectorDetail[msg.sender],getAADepartmentUser(msg.sender),getStudentByAddr(msg.sender),getCompany(msg.sender));
        } else if (keccak256(abi.encodePacked(userRole[msg.sender].id)) == keccak256(abi.encodePacked("2"))){
            return (rectorDetail[msg.sender],getAADepartmentUser(msg.sender),getStudentByAddr(msg.sender),getCompany(msg.sender));
        } else if (keccak256(abi.encodePacked(userRole[msg.sender].id)) == keccak256(abi.encodePacked("3"))){
            return (rectorDetail[msg.sender],getAADepartmentUser(msg.sender),getStudentByAddr(msg.sender),getCompany(msg.sender));
        }
    }

    modifier onlyUser(address _address) {
        require(msg.sender == _address || msg.sender == currentRectorAddress);
        _;
    }

     modifier onlyNoRole(address _address) {
        require(keccak256(abi.encodePacked(userRole[_address].id)) == keccak256(abi.encodePacked("")));
        _;
    }

    function setRole() private {
        roleList[0] = (role("0","rector"));
        roleList[1] = (role("1","AADepartment"));
        roleList[2] = (role("2","student"));
        roleList[3] = (role("3","company"));
    }

    struct rector{
        string name;
        string date;
        string phone;
        string term;
    }

    address currentRectorAddress; 

    mapping(address => rector) rectorDetail;

    modifier onlyCurrentRector() {
        require(msg.sender == currentRectorAddress);
        _;
    }

    function setRector() private {
        rector memory rectorTemp;
        rectorTemp.name = "PGS TS Nguyen Viet Ha";
        rectorTemp.date = "1974";
        rectorTemp.phone = "0989152252";
        rectorTemp.term = "from 2014";
        rectorDetail[msg.sender] = rectorTemp;
        userRole[msg.sender] = roleList[0];

        currentRectorAddress = msg.sender;

    }

    function getCurrentRector() public view returns (rector memory) {
        rector memory currentRector = rectorDetail[currentRectorAddress];
        return currentRector;
    }

    function createNewRector(address _newRectorAddr, string memory _name,string memory _date,string memory _phone, string memory _term) public onlyCurrentRector onlyNoRole(_newRectorAddr) {
        rector memory newRector = rector(_name, _date, _phone, _term);

        rectorDetail[_newRectorAddr] = newRector;
        userRole[_newRectorAddr] = roleList[0];

        currentRectorAddress = _newRectorAddr;
    }

    function updateCurrentRector(string memory _name,string memory _date,string memory _phone, string memory _term) public onlyCurrentRector {
        rectorDetail[msg.sender].name = _name;
        rectorDetail[msg.sender].date = _date;
        rectorDetail[msg.sender].phone = _phone;
        rectorDetail[msg.sender].term = _term;
    }


    // Academic Affairs Department
    struct AADepartment {
        string realAddress; // dia chi PDT
        string description;
    }

    struct AADUser {
        string name;
        string date;
        string phone;
        bool isActive;
    }

    AADepartment AADepartmentAcc;

    AADUser[] AADUserList;
    mapping(address => AADUser) AADUsers;

    modifier onlyAADepartmentUser() {
        AADUser memory currentUser = AADUsers[msg.sender];
        require(currentUser.isActive == true);
        _;
    }

    modifier onlyRectorOrAAD() {
        require(msg.sender == currentRectorAddress || AADUsers[msg.sender].isActive == true);
        _;
    }

    function setAADepartmentAcc() private {
        AADepartmentAcc.realAddress = "E3 144 Xuan Thuy - Cau Giay - Ha Noi";
        AADepartmentAcc.description = " tham muu giup viec Hieu truong thuc hien cong tac ve xay dung, quan ly cac chuong trinh dao tao";
    }

    function getAADepartmentAcc() public view returns (AADepartment memory){
        return AADepartmentAcc;
    }

    function createAADepartmentUser(address _address, string memory _name, string memory _date, string memory _phone) public onlyRectorOrAAD onlyNoRole(_address) {
        AADUser memory temp = AADUser(_name, _date, _phone, true);
        AADUserList.push(temp);
        AADUsers[_address] = temp;
        userRole[_address] = roleList[1];
    }

    function updateAADepartmentUser(string memory _name, string memory _date, string memory _phone) public {
        require(AADUsers[msg.sender].isActive == true);
        AADUsers[msg.sender].name = _name;
        AADUsers[msg.sender].date = _date;
        AADUsers[msg.sender].phone = _phone;
    }

    function deactiveAADepartmentUser(address _address) public onlyRectorOrAAD{
        AADUsers[_address].isActive = false;
    }

    function getAADepartmentUser(address _userAddress) public view returns (AADUser memory) {
        return AADUsers[_userAddress];
    }

    struct student {
        address account;
        string studentId;
        string name;
        string email;
        string phone;
        string class;
        string major;
        string cpa;
        bool qualifiedForGraduation;
        bool isActive;
        uint nonce;
    }

    student[] studentList;
    mapping(address => student) studentDetails;
    mapping(string => student) idToStudents;

    function createStudent(string memory _studentId, string memory _name, string memory _email, string memory _phone, string memory _class, string memory _major, string memory _cpa, bool _qualifiedForGraduation) public onlyAADepartmentUser {
        student memory studentTemp = student(address(0x0), _studentId, _name, _email, _phone, _class, _major, _cpa, _qualifiedForGraduation, false, uint(keccak256(abi.encodePacked(_studentId, block.timestamp, block.difficulty))));
        studentList.push(studentTemp);
        idToStudents[_studentId] = studentTemp;
    }

    function activeStudent(string memory _studentId, uint _nonce) public onlyNoRole(msg.sender) {
        require(_nonce == idToStudents[_studentId].nonce);
        idToStudents[_studentId].account = msg.sender;
        idToStudents[_studentId].isActive = true;
        userRole[msg.sender] = roleList[2];

        studentDetails[msg.sender] = idToStudents[_studentId];
    }

    function gettAllStudent() public view onlyRectorOrAAD returns(student[] memory){
        return studentList;
    }

    function getStudentById(string memory _studentId) public view returns(student memory){
        student memory studentTemp = idToStudents[_studentId];
        studentTemp.nonce = 0;
        return studentTemp;
    }

    function getStudentByAddr(address _studentAddr) public view returns(student memory){
        student memory studentTemp = studentDetails[_studentAddr];
        studentTemp.nonce = 0;
        return studentTemp;
    }

    function getStudentNonce(string memory _studentId) public view onlyRectorOrAAD returns(uint) {
        return idToStudents[_studentId].nonce;
    }

    function updateStudentbyAAD(address _address, string memory _studentId, string memory _name, string memory _email, string memory _phone, string memory _class, string memory _major, string memory _cpa, bool _qualifiedForGraduation) public onlyRectorOrAAD {
        student storage temp = studentDetails[_address];
        temp.studentId = _studentId;
        temp.name = _name;
        temp.email = _email;
        temp.phone = _phone;
        temp.class = _class;
        temp.major = _major;
        temp.cpa = _cpa;
        temp.qualifiedForGraduation = _qualifiedForGraduation;
    }

    function updateStudentInfo(string memory _email, string memory _phone) public {
        require(studentDetails[msg.sender].isActive == true);
        studentDetails[msg.sender].email = _email;
        studentDetails[msg.sender].phone = _phone;
    }

    struct company{
        string name;
        string description;
        string jobInfo;
        bool isActive;
    }

    company[] companyList;
    mapping(address => company) companyDetails;

    function createCompany(string memory _name, string memory _description, string memory _jobInfo) public onlyNoRole(msg.sender) {
        company memory companyTemp = company(_name, _description, _jobInfo, false);

        companyList.push(companyTemp);
        companyDetails[msg.sender] = companyTemp;
        userRole[msg.sender] = roleList[3];
    }

    function approveCompany(address _companyAddr) public onlyAADepartmentUser {
        companyDetails[_companyAddr].isActive = true;
    }

    function updateCompany(string memory _name, string memory _description, string memory _jobInfo) public {
        companyDetails[msg.sender].name = _name;
        companyDetails[msg.sender].description = _description;
        companyDetails[msg.sender].jobInfo = _jobInfo;
    }

    function getCompany(address _companyAddr) public view returns(company memory){
        company memory companyTemp = companyDetails[_companyAddr];
        return companyTemp;
    }

    function getAllCompany() public view returns(company[] memory) {
        return companyList;
    }
}
